using System.Diagnostics;

namespace _438_find_all_anagrams_in_string
{
    internal class Program
    {
        static bool IsAnagram(ReadOnlySpan<char> s, string p, Dictionary<char, int> sDict, Dictionary<char, int> pDict)
        {
            for (int i = 0; i < s.Length; i++)
            {
                sDict[s[i]] = sDict.GetValueOrDefault(s[i]) + 1;
            }

            foreach (var kvp in pDict)
                if (sDict.GetValueOrDefault(kvp.Key) != kvp.Value)
                    return false;

            return true;
        }

        public static IList<int> FindAnagrams(string s, string p)
        {
            var sw = Stopwatch.StartNew();
            var result = new List<int>();
            if (s.Length < p.Length)
                return result;
            var str = s.ToArray();
            var pDict = new Dictionary<char, int>();
            foreach (var c in p)
                pDict[c] = pDict.GetValueOrDefault(c) + 1;

            var sDict = new Dictionary<char, int>();

            for (int i = 0; i <= s.Length - p.Length; i++)
            {
                var ss = str[i..(i + p.Length)];
                for (int j = 0; j < ss.Length; j++)
                {
                    sDict[ss[j]] = sDict.GetValueOrDefault(ss[j]) + 1;
                }
                
                var found = true;
                foreach (var kvp in pDict)
                    if (sDict.GetValueOrDefault(kvp.Key) != kvp.Value)
                    {
                        found = false;
                        break;
                    }
                if (found)
                    result.Add(i);

                sDict.Clear();
            }
            sw.Stop();
            Console.WriteLine(sw.Elapsed);
            return result;
        }

        public static IList<int> FindAnagrams2(string s, string p)
        {
            var sw = Stopwatch.StartNew();
            var result = new List<int>();
            if (s.Length < p.Length)
                return result;
            //var str = s.ToArray();
            var pDict = new Dictionary<char, int>();
            foreach (var c in p)
                pDict[c] = pDict.GetValueOrDefault(c) + 1;

            var sDict = new Dictionary<char, int>();
            for (int i = 0; i < s.Length; i++)
            {
                sDict[s[i]] = sDict.GetValueOrDefault(s[i]) + 1;
                if (i >= p.Length - 1)
                {
                    bool found = true;
                    foreach (var kvp in pDict)
                    {
                        if (sDict.GetValueOrDefault(kvp.Key) != kvp.Value)
                        {
                            found = false;
                            break;
                        }
                    }
                    if (found)
                        result.Add(i - p.Length + 1);

                    var charToRemove = s[i - p.Length + 1];
                    sDict[charToRemove]--;
                    if (sDict[charToRemove] == 0)
                        sDict.Remove(charToRemove);
                }
            }
            sw.Stop();
            Console.WriteLine(sw.Elapsed);
            return result;
        }

